  [],\n\t\"revision_timestamp\": \"2015-05-07T01:22:01.360788\",\n\t\"name\": \"uas-demand-generator-for-discrete-airspace-density-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"A key component to solving many engineering
  challenges of UAS integration into the National Airspace System is the ability to
  state the numbers of forecasted UAS by airframe and mission/operation type being
  performed within discrete airspaces. UAS growth is a function of locational based
  businesses and public use needs, in addition to increases in UAS uses and future
  aircraft types. Being able to forecast this growth requires time consuming and highly
  detailed configuration and model development, consensus between different organizations,
  and flexible tools tunable to changing perspectives. Availability of a common cloud
  based application integrating varying growth curves and linking geospatial aspects
  of UAS operations will greatly enhance and stabilize system level analysis of issues
  such as: radio spectrum usage, safety case analysis, economic forecasts, etc. Individuals
  and organizations would benefit in using a community centric tool with the ability
  to shared data and projections while still allowing individual researchers to set
  up paradigms for their own, unique forecasts.  The overall project objective is
  to design, develop, and study the feasibility and potential benefits of a UAS Demand
  Generator for Discrete Airspace Density (UAxpan) system which allows for common
  solutions in complex forecasts of growth and uses of numerous unmanned systems and
  mission/operational types. This will be accomplished by developing and testing a
  prototype system and performing the key functionality objectives using real industry,
  UAS, geographic, and NAS data.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
